import Container from '@mui/material/Container';
import Box from '@mui/material/Box';

const Home = () => {
    return (
        <main>
            <div className="container">
                <Container maxWidth="md">
                    <Box sx={{ bgcolor:'#fbbf24' , height:'100vh'}}></Box>
                </Container>
            </div>

            <Box  className="div-body mt-5" sx={ { fontWeight : 'bold', textAlign }}>
                    dfg
            </Box>
        </main>
    );
}

export default Home;
